function cookieInit() {
    const cookieMessage = document.querySelector('[data-js="cookie"]');

    if(!cookieMessage) return

    const cookieBtn = cookieMessage.querySelector('[data-js="cookieBtn"]');
    const cookieName = 'cookie_policy'

    let currentCookieValue = document.cookie.match(new RegExp("(?:^|; )" + cookieName.replace(/([\.$?*|{}\(\)\[\]\\\/\+^])/g, '\\$1') + "=([^;]*)"));

    if (!currentCookieValue) {
        $(cookieMessage).fadeIn('slow');
    }

    cookieBtn.addEventListener('click', function () {
        document.cookie = `${cookieName}=true`
        $(cookieMessage).fadeOut('slow');
    });
}

gsap.registerPlugin(ScrollTrigger)
gsap.registerPlugin(ScrollToPlugin)

let scrollTriggerObject;
let mainTimeline = gsap.timeline();
let addTime = 1200;


const preloader = document.querySelector('[data-js="preloader"]')
const currentPage = document.querySelector('[data-js="pageAnimWrap"]')
let currentPageName = currentPage ? currentPage.dataset.page : ""

const windowHeight = window.innerHeight
const windowWidth = window.innerWidth

let currentWindowWidth = windowWidth


if(preloader !== null ) {
	setTimeout(() => {
		$(preloader).fadeOut("slow")
        $('body').removeClass('no-scroll')

        switch(currentPageName) {
            case "home":
                document.querySelector('[data-js="siteHeaderLogoFull"] img').setAttribute('src', './img/logo_full.png')
                titlesMarkup();
                heightAnimMarkup();
                homeIntroAnim();
                startPageAnimation();
                cursorRunAway();
                break;
            case "projects":
                titlesMarkup();
                heightAnimMarkup();
                startPageAnimation();
                break;
            case "project":
                titlesMarkup();
                heightAnimMarkup();
                startPageAnimation();
                break;
            case "services":
                projectsAnimationMarkup();
                startPageAnimation();
                break;
            case "service":
                projectsAnimationMarkup();
                startPageAnimation();
                break;
            default:
                titlesMarkup();
                cookieInit();
                projectsAnimationMarkup();
                startPageAnimation();
                cursorRunAway();
                break
        }

	}, 1600)
}

function startPageAnimation() {
    switch(currentPageName) {
        case "home":
            homePageAnimation()
            break;
        case "projects":
            projectsPageAnimation()
            break;
        case "project":
            projectPageAnimation()
            break;
        case "services":
            servicesPageAnimation()
            break;
        case "service":
            servicePageAnimation()
            break;
        case "common":
            commonPageAnimation()
            break;
        default:
            defaultHeaderAnim()
            break
    }
}

function refreshPageAnimation() {
    if(typeof scrollTriggerObject !== "undefined") {
        scrollTriggerObject.kill();
        mainTimeline.clear();
        startPageAnimation();
    }
}

window.addEventListener('resize', () => {
    if(currentWindowWidth !== window.innerWidth) {
        refreshPageAnimation()
        currentWindowWidth = window.innerWidth;
    } else {
        return
    }
});

/** Стартовая анимация первого экрана главной страницы */
function homeIntroAnim() {

    document.activeElement.blur()

    let windowWidth = $(window).width()
    let fakeLogoTop = '54px'

    if(windowWidth < 1200) {
        fakeLogoTop = '47px'
    }

    if(windowWidth < 501) {
        fakeLogoTop = '37px'
    }

    if(document.querySelector('[data-js="homeIntro"]')) {
        let tl = gsap.timeline();
        //ставим на место лого
        tl.to('[data-js="homeIntroFakeLogo"]', {
            top: fakeLogoTop,
            duration: 0.5,
            delay: 0.5
        })
        //показываем элементы
        tl.to('[data-js="homeIntroBg"] > *', {
            opacity: '1',
            duration: 1,
        }, '<')
        tl.to('[data-js="homeIntroFake1"]', {
            opacity: '1',
            duration: 1
        }, '<')
        tl.to('[data-js="homeIntroFake4"]', {
            opacity: '1',
            duration: 1
        }, '<')
        tl.to('[data-js="homeIntroFake2"]', {
            opacity: '1',
            duration: 1
        }, '<')
        tl.to('[data-js="homeIntroFake3"]', {
            opacity: '1',
            duration: 1
        }, '<')
        tl.to('[data-js="homeIntroFake5"]', {
            opacity: '1',
            duration: 1
        }, '<')

        tl.to('[data-js="siteHeader"]', 
        {
            opacity: '1',
            duration: 0.5
        }, '>')

        mainTimeline.to('[data-js="homeIntroFakeLogo"]', 
        {
            opacity: 0,
            duration: 1
        }, '>')
        mainTimeline.to('[data-js="homeIntroFakeLogo"]', 
        {
            display: ''
        }, 
        {
            display: 'none',
            duration: 0,
        }, '>')

    }
}

