function validation() {

    const forms = document.querySelectorAll('[data-validate]')

    if (!forms.length) return

    forms.forEach(form => {

        inputMasksInit(form);

        form.addEventListener('submit', event => {
            event.preventDefault()

            const inputFields = form.querySelectorAll('[data-js="formField"]');
            const dataReqexp = {
                email: /^([A-Za-z0-9_\-\.])+\@([A-Za-z0-9_\-\.])+\.([A-Za-z]{2,})$/,
                space: /^(\s)+$/,
            }

            function error(el, errorText = "") {
                let errorField = el.querySelector("[data-js='fieldError']")
                return {
                    set: () => {
                        el.classList.add("field--invalid")
                        errorField.innerHTML = errorText
                    },
                    remove: () => {
                        el.classList.remove("field--invalid")
                        errorField.innerHTML = errorText
                    },
                }
            }

            function validateInput(input) {
                const field = input.querySelector('input');

                if(!field) return

                const name = field.getAttribute('data-v-name');
                let valueField = name === "file" ? field.files : field.value;
                let spaceTrigger = name === "file" ? true : !valueField.match(dataReqexp.space);

                if (field.hasAttribute('required') && !field.hasAttribute('disabled')) {
                    if (valueField !== '' && spaceTrigger) {
                        switch (name) {
                            case 'phone':
                                valueField = valueField.replace(/\D/g, "")

                                if (valueField.length === 11) {
                                    error(input).remove()
                                } else {
                                    error(input, 'Ошибка ввода').set()
                                }
                                break                               
                            default:
                                if (valueField.length !== 0) {
                                    error(input).remove()
                                } else {
                                    error(input, "Ошибка ввода").set()
                                }
                        }
                    } else {
                        error(input, 'Ошибка ввода').set()
                    }
                }
            }

            function checkFields() {
            
                inputFields.forEach(input => {
                    validateInput(input)
                })
            }

            function lifeValidate() {
                inputFields.forEach(input => {
                    input.addEventListener('click', () => {
                        if (form.getAttribute('data-validate')) {
                            const field = input.querySelector('input')

                            field.addEventListener('input', () =>
                                validateInput(input),
                            )
                            checkFields()
                        }
                    })
                })
            }

            function validate() {
                let errors = 0

                inputFields.forEach(input => {
                    if (input.classList.contains('field--invalid')) {
                        errors += 1
                    }
                })

                // тут отправляем данные
                if (errors === 0) {
                    const formData = new FormData(form);

                    console.log('данные формы:')
                    console.log(formData)
                    form.reset();

                    thanksMessageShow();
                } else {
                    console.log('форма заполнена неверно')
                }
            }

            lifeValidate()
            checkFields()
            form.setAttribute('data-validate', 'true')

            validate()
        })
    })
}

function inputMasksInit(form) {

    const phones = form.querySelectorAll('input[data-type="phoneNumber"]');

    if(phones.length > 0) {
        phones.forEach(phone => {
            Inputmask({
                'mask': '+7 (999) 999-99-99',
                'showMaskOnHover': false
            }).mask(phone); 
        })
    }
}

function thanksMessageShow() {
    modals.open('#thankMessage')
}
function videoControlInit() {
    const videoContainers = document.querySelectorAll("[data-js='videoContainer']");

    if(videoContainers.length < 1) return

    videoContainers.forEach(videoContainer => {
        const videoBtnsBlock = videoContainer.querySelector("[data-js='videoBtnsBlock']");
        const videoPlayBtn = videoBtnsBlock.querySelector("[data-js='videoBtnPlay']");
        const videoPauseBtn = videoBtnsBlock.querySelector("[data-js='videoBtnPause']");
        const videoElement = videoContainer.querySelector("video");
    
        if(window.innerWidth > 1024) {
            videoContainer.addEventListener('mouseover', () => {
                //videoElement.setAttribute('controls', '');
                videoBtnsBlock.classList.add("active");
            })
            videoContainer.addEventListener('mouseout', () => {
                //videoElement.removeAttribute('controls');
                videoBtnsBlock.classList.remove("active");
            })
        } else {
            let btnDeleteTimer;
            videoContainer.addEventListener('click', () => {
                videoElement.setAttribute('controls', '');
                clearInterval(btnDeleteTimer);
    
                const startTime = new Date;
    
                btnDeleteTimer = setInterval(function() {
                    const now = new Date();
                    const diff = now - startTime;
                    if(diff > 2500) {
                        videoElement.removeAttribute('controls');
                        clearInterval(btnDeleteTimer);
                    }
                }, 300);
            })
        }
    
    
        videoPlayBtn.addEventListener('click', () => {
            videoElement.play();
        })
    
        videoPauseBtn.addEventListener('click', () => {
            videoElement.pause();
        })
    
        videoElement.addEventListener("pause", () => {
            videoPauseBtn.classList.remove('active')
            videoPlayBtn.classList.add('active')
        })
    
        videoElement.addEventListener("play", () => {
            videoPlayBtn.classList.remove('active')
            videoPauseBtn.classList.add('active')
        })
    })
 
}
function projectCardCursor() {
    const projectCards = document.querySelectorAll('[data-js="projectCard"]')

    if(projectCards.length < 1) return

    let cursorIcon = document.querySelector('[data-js="projectCardCursor"]');
    projectCards.forEach(card => {
        card.addEventListener('mouseenter', (e) => {
            cursorIcon.style.opacity = 1;
            cursorIcon.style.visibility = 'visible';
            $(cursorIcon).css({
                left:  e.clientX,
                top:   e.clientY
            });
        })

        card.addEventListener('mouseleave', (e) => {
            cursorIcon.style.opacity = 0;
            cursorIcon.style.visibility = 'hidden';
        })


        card.addEventListener('mousemove', function(e){
            $(cursorIcon).css({
                left:  e.clientX,
                top:   e.clientY
            });
        })
    })
}

document.addEventListener('DOMContentLoaded', () => {
    validation()
    videoControlInit()
    projectCardCursor()
})
gsap.registerPlugin ( ScrollTrigger );

function headerControllInit() {
    let oldScrollY = 0;
    let header = $('[data-js="siteHeader"]');
    let screenHeight = $(window).height();

    let coeff1 = 3.85
    let coeff2 = 3.5
    let coeff3 = 3.3

    let page = document.querySelector('[data-js="pageAnimWrap"]')

    if(page){
        let pageName = page.getAttribute("data-page")

        if(pageName == "projects" || pageName == "project" || pageName == "service") {
            coeff1 = 0.85
            coeff2 = 0.5
            coeff3 = 0.3
        }

        if(pageName == "services") {
            coeff1 = 0.3
            coeff2 = 0.4
            coeff3 = 0.4
        }
    }
    
    const initScroll = $(window).scrollTop();

    if(initScroll > screenHeight * coeff1) {
        header.addClass("site-header--small");
        header.addClass("site-header--hidden");
    }

    $(window).scroll(function() {
        const scroll = $(window).scrollTop();

        if(scroll > oldScrollY) {
            if(scroll >= screenHeight  * coeff2) {
                header.addClass("site-header--small");
            }
            if(scroll >= screenHeight * coeff3) {
                header.addClass("site-header--hidden");
            }
        } else {
            if(scroll < screenHeight * coeff2) {
                header.removeClass("site-header--small");
            }

            if(scroll > screenHeight || scroll < screenHeight * coeff3) {
                header.removeClass("site-header--hidden");
            } else {
                header.addClass("site-header--hidden");
            }
        }

        oldScrollY = scroll

    });
}

function homeReviews() {
        // Инициализируем слайдер
        const homeReviewsSlider = document.querySelector('[data-js="homeReviewsSlider"]');
    
        if(!homeReviewsSlider) return

        const prevBtn = homeReviewsSlider.querySelector('[data-js="sliderControlPrev"]')
        const nextBtn = homeReviewsSlider.querySelector('[data-js="sliderControlNext"]')
        const pagination = homeReviewsSlider.querySelector('[data-js="sliderPagination"]')
    
        let homeReviewsSliderEx = new Swiper(homeReviewsSlider, {
            slidesPerView: 1,
            effect: 'fade',
            speed: 1000,
            loop: true,
            navigation: {
                nextEl: nextBtn,
                prevEl: prevBtn,
            },
            pagination: {
                el: pagination,
                type: 'bullets',
                clickable: true
              },

        })

        // Открываем/закрываем полный отзыв
        const fullReviewOpenBtns = homeReviewsSlider.querySelectorAll('[data-js="fullReviewOpen"]')
        const fullReviewCloseBtns = homeReviewsSlider.querySelectorAll('[data-js="fullReviewClose"]')
        const homeReviewsHeader = homeReviewsSlider.querySelector('[data-js="homeReviewsHeader"]')
        const homeReviewsPagination = homeReviewsSlider.querySelector('[data-js="sliderPagination"]')

        fullReviewOpenBtns.forEach(btn => {
            btn.addEventListener('click', function(e) {
                let currentSlide = e.target.closest('[data-js="homeReviewsSlide"]')
                let currentFullReview = currentSlide.querySelector('[data-js="fullReview"]')

                homeReviewsHeader.classList.add('hidden')
                homeReviewsPagination.classList.add('hidden')
                currentFullReview.classList.add('active')
            })
        })

        fullReviewCloseBtns.forEach(btn => {
            btn.addEventListener('click', function(e) {
                let currentFullReview = e.target.closest('[data-js="fullReview"]')

                homeReviewsHeader.classList.remove('hidden')
                homeReviewsPagination.classList.remove('hidden')
                currentFullReview.classList.remove('active')
            })
        })
}
function mProjects() {
    const mProjectsEl = document.querySelector('[data-js="mProjects"]')
    

    if(!mProjectsEl) return

    projectsAnimationMarkup()

    const windowWidth = $(window).width()

    if(windowWidth > 1199) {
        mProjectsSliderInit(mProjectsEl)
    } else {
        return
    }

}

function mProjectsSliderInit(mProjectsEl) {
    const tabs = mProjectsEl.querySelector('[data-js="mProjectsTabs"]');
    const slides = mProjectsEl.querySelector('[data-js="mProjectsSlides"]');

    let tabsSliderEx = new Swiper(tabs, {
        slidesPerView: 'auto',
        speed: 1000,
        spaceBetween: 4,
        freeMode: true,
        breakpoints: {
        }
    })

    let slidesSliderEx = new Swiper(slides, {
        slidesPerView: 1,
        effect: 'fade',
        speed: 1000,
        allowTouchMove: false,
        autoHeight: true,
        thumbs: {
            swiper: tabsSliderEx
        },
    })

    slidesSliderEx.on('transitionEnd', function () {
        let currentScroll = window.scrollY
        refreshPageAnimation()
        gsap.to(window, { duration: 0.001, scrollTo: { y: currentScroll, offsetY: 0 } });
    })
   
}

